INSERT INTO `sources` VALUES (1,'N/A','','','admin@cafevariome.org','diagnostic_notts','http://www.cafevariome.org','Diagnostic Lab Nottingham','Diagnostic Lab Nottingham','online','mysql','0000-00-00 00:00:00','','','','','','','',''),(2,'Cafe Variome','','','admin@cafevariome.org','diagnostic_leic','http://www.cafevariome.org','Diagnostic Lab Leicester','Diagnostic Lab Leicester','online','mysql','0000-00-00 00:00:00','','','','','','','',''),(3,'Cafe Variome','','','admin@cafevariome.org','diagnostic_sheff','http://www.cafevariome.org','Diagnostic Lab Sheffield','Diagnostic Lab Sheffield','online','mysql','0000-00-00 00:00:00','','','','','','','',''),(4,'Cafe Variome','','','admin@cafevariome.org','dbsnp','http://www.ncbi.nlm.nih.gov/projects/SNP/','dbSNP','dbSNP data in Cafe Variome comes from human build 137 (coding regions).\n\nThe Single Nucleotide Polymorphism Database (dbSNP) is a free public archive for genetic variation within and across different species developed and hosted by the National Center for Biotechnology Information (NCBI) in collaboration with the National Human Genome Research Institute (NHGRI).','online','mysql','0000-00-00 00:00:00','','','','','','','',''), (5,'DMuDB','','','support@dmudb.net','dmudb','http://www.ngrl.org.uk/Manchester/projects/informatics/dmudb','Diagnostic Mutation Database','The Diagnostic Mutation Database (DMuDB) was established in 2005 by NGRL as a repository of diagnostic variant data, to support the diagnostic process in UK genetic testing laboratories. NGRL developed DMuDB in response to a need amongst UK laboratories for an easy and secure way to share variant data in order to support the interpretation of new variants and improve the quality and consistency of diagnoses. Access to DMuDB has now been extended to non-UK laboratories through a partnership with EMQN. ','online','mysql','0000-00-00 00:00:00','','','','','','','','');
